import React from 'react';
import {Login, Navbar} from './components/Login'
import 'semantic-ui-css/semantic.min.css'
import './App.css';
function App() {
  return (
    <div className="App">
      <Navbar/>
    <Login/>
    </div>
  );
}

export default App;
